import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Route } from 'react-router-dom';
import NavBar from './Containers/NavBar/NavBar';
function App() {
  return (
  <>
    <NavBar/>
    <Routes>
        <Route path="/" element={<HomeContainer/>}/>
        <Route path="/Ecrire" element={<CreateArticle/>}/>
        <Route path="/Contact" />
    </Routes>
  </>
  );
}

export default App;
